```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>

# Find the author of "French Algeria"
SELECT ?author WHERE {
  dbr:French_Algiers dbo:author ?author .
}

# Find people decedent at the work of the author
SELECT ?decedent1 WHERE {
  ?decedent1 dbo:livedDuring ?timePeriod .
  ?timePeriod dbo:startDate ?startDate ;
              dbo:endDate ?endDate .
  ?author dbo:livedDuring ?authorTimePeriod .
  FILTER(?startDate <= ?endDate && ?startDate >= ?authorTimePeriod)
}

# Find the capital of Algeria
SELECT ?capital WHERE {
  dbr:Algeria dbo:capital ?capital .
}

# Find people decedent at the capital of Algeria
SELECT ?decedent2 WHERE {
  ?decedent2 dbo:livedDuring ?timePeriod .
  ?timePeriod dbo:startDate ?startDate ;
              dbo:endDate ?endDate .
  FILTER(?startDate <= ?endDate && ?capital IN (dbr:Algiers))
}

# Combine both parts
SELECT DISTINCT ?decedent1, ?decedent2 WHERE {
  ?decedent1 dbo:livedDuring ?timePeriod1 .
  ?timePeriod1 dbo:startDate ?startDate1 ;
              dbo:endDate ?endDate1 .
  ?author dbo:livedDuring ?authorTimePeriod .
  FILTER(?startDate1 <= ?endDate1 && ?startDate1 >= ?authorTimePeriod)
}
UNION
SELECT DISTINCT ?decedent2 WHERE {
  ?decedent2 dbo:livedDuring ?timePeriod2 .
  ?timePeriod2 dbo:startDate ?startDate2 ;
              dbo:endDate ?endDate2 .
  FILTER(?startDate2 <= ?endDate2 && ?capital IN (dbr:Algiers))
}
